import React from 'react';
import PostData from '../data/schoolProfiles.json';

function PostList() {
  return (
    <div>
      <h1>School Profiles</h1>
      {PostData.map((schoolProfile, index)=>{
        return <>
        <div>
          <div>
            <img style={{width: 100 + 'px', height: 100 + 'px'}} src={schoolProfile.schoolLogoUrl}></img>
          </div>
          <h2>{schoolProfile.name}</h2>
          <p>{schoolProfile.address}</p>
        </div>
        </>
      })}
    </div>
  );
}

export default PostList;
